import React, { Component } from "react"

class UserList extends Component{
    render() {
        return (
            <table className="table">
  <thead>
    <tr>
      <th scope="col">#</th>
      <th scope="col">Id</th>
      <th scope="col">Name</th>
      <th scope="col">Job</th>
    </tr>
  </thead>
  <tbody>
                    {users.map(user => {
                        <tr>
                            <th scope="row">{user.index}</th>
                            <td>{user.name}</td>
                            <td>{user.job}</td>
                            <td>Delete</td>
                        </tr>
                    })}
  </tbody>
</table>
        )
    }
}

export default UserList;
